import React from 'react';
import './card-list.styles.css';

export const CardList = props => {

    console.log(props);
    return <div className='card-list'>
    {this.state.fruits.map(fruit =>(
        <h1 key={fruit.imageurl}>{fruit.tfvname}</h1>
      ))}
    </div>;
};
